import React, { Component } from 'react'
import Navbar from "../components/Navbar"

import PeopleFeature from "./PeopleFeature"

class Quiz extends Component {
  render() {
    return (
      <div className="quiz-container">
        <Navbar active="quiz"/>
        <div className="container">
          <PeopleFeature/>
        </div>
      </div>
    )
  }
}

export default Quiz;
